import Navi from "./components/Navi";
import CategoryList from "./components/CategoryList";
import ProductList from "./components/ProductList";
import { Container, Row } from "reactstrap";
function App() {
  return (
    <div>
      <Container>
        <Row>
          <Navi />
        </Row>
        <Row>
          <col x="3">
            <CategoryList />            
          </col>
          <col x="9">
            <ProductList />
          </col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
